    super(props);

  }

  componentDidMount() {
  }

  componentDidUpdate() {
  }


  render() {
    return (
      <div class="header-container">
        <h2>Mentor On Demand</h2>
        <div class="pull-right">
          <Link to="/login">
            <button type="button" class="btn btn-warning"
              style={{padding: '10px 70px'}}
              >Login</button>
          </Link>
        </div>
      </div>
    );
  }
}
export default Header;
